function Project(props){
    return <React.Fragment>
            <h1>
                {props.title}
            </h1>
            <p>
                {props.description}
            </p>
        </React.Fragment>;
}

function WorkExperience(props){
    return <React.Fragment>
        <h1>{props.title}</h1>
        <h1>{props.dateRange}</h1>
        <p>{props.description}</p>
    </React.Fragment>
}

function GeneralInfo(props){
    return <React.Fragment>
        <h1>{props.title}</h1>
        <p>{props.content}</p>
    </React.Fragment>
}
